import React,  { Component } from 'react';
import { connect } from 'react-redux';
import { startTest } from '../store';
import Button from '@material-ui/core/Button';
import { IgrPieChartModule } from 'igniteui-react-charts';
IgrPieChartModule.register();


class Start extends Component {
  constructor(props) {
    super(props);

    qnumber:0;
    this.doStart = this.doStart.bind(this);
  }

  doStart(e){
    let action = startTest();
    this.props.dispatch(action);
  }

  render(){
    return(
      <div>
        <div>
          <Button variant="contained" color="primary" onClick={this.doStart}>
            10問Start
          </Button> 
        </div>
        <div>
          <Button variant="contained" color="secondary" onClick={this.doStart}>
            30問Start
          </Button> 
        </div>
        <div>
          <Button variant="contained" color="primary" onClick={this.doStart}>
            50問Start
          </Button> 
        </div>
        <div>
          <Button variant="contained" color="secondary" onClick={this.doStart}>
            50問Start
          </Button> 
        </div>
      </div>
    );
  }
}

Start = connect((state) => state)(Start);
export default Start;
